import React, { useEffect, useState } from 'react';
import {
  Container, Typography, Grid, Paper, Box, AppBar, Toolbar, CssBaseline, Button, Drawer, List,
  ListItem, ListItemIcon, ListItemText, TextField
} from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import {
  Dashboard as DashboardIcon, ShoppingCart as ShoppingCartIcon, Settings as SettingsIcon,
  Calculate as CalculateIcon, ExitToApp as ExitToAppIcon
} from '@mui/icons-material';
import { BrowserRouter, Link, Route, Routes, useNavigate } from 'react-router-dom';
import FeeCalculatorPage from './FeeCalculator';
import Settings from './Settings';
import Logout from './Logout';
import UserDashboard from './UserDashboard';
import ProductCard from '../components/ProductCard';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#1c1c1c',
      paper: '#2c2c2c',
    },
    text: {
      primary: '#ffffff',
    },
  },
});

function Products() {
  const [products, setProducts] = useState([]);
  const [query, setQuery] = useState("");
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      const response = await fetch('http://localhost:8000/products?skip=0&limit=10', {
        credentials: 'include',
        headers: {
          'Authorization': 'Basic ' + btoa('juggy:Idus1234@@'),
          'Content-Type': 'application/json',
        },
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(`Error: ${response.status} - ${errorData.detail}`);
      }

      const data = await response.json();
      setProducts(data);
    } catch (error) {
      console.error('Fetch error:', error);
    }
  };

  const handleSearch = async () => {
    setLoading(true);
    if (!query) return;
    try {
      const response = await fetch(`http://localhost:8000/search/?query=${query}`);
      const data = await response.json();
      setProducts(data);
    } catch (error) {
      console.error('Search error:', error);
    }
    setLoading(false);
  };

  const handleKeyDown = (e) => {
    if (e.key === 'Enter') {
      e.preventDefault();
      handleSearch();
    }
  };

  const drawerWidth = 240;

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="fixed" sx={{ zIndex: theme.zIndex.drawer + 1 }}>
        <Toolbar>
          <Typography variant="h6" style={{ flexGrow: 1 }}>
            FlipVault
          </Typography>
          <Button color="inherit" component={Link} to="/login">Log in</Button>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          [`& .MuiDrawer-paper`]: { width: drawerWidth, boxSizing: 'border-box' },
        }}
      >
        <Toolbar />
        <Box sx={{ overflow: 'auto' }}>
          <List>
            <ListItem button component={Link} to="/user-dashboard" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <DashboardIcon />
              </ListItemIcon>
              <ListItemText primary="Dashboard" />
            </ListItem>
            <ListItem button component={Link} to="/products" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <ShoppingCartIcon />
              </ListItemIcon>
              <ListItemText primary="Products" />
            </ListItem>
            <ListItem button component={Link} to="/fee-calculator" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <CalculateIcon />
              </ListItemIcon>
              <ListItemText primary="Fee Calculator" />
            </ListItem>
            <ListItem button component={Link} to="/settings" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <SettingsIcon />
              </ListItemIcon>
              <ListItemText primary="Settings" />
            </ListItem>
            <ListItem button component={Link} to="/logout" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <ExitToAppIcon />
              </ListItemIcon>
              <ListItemText primary="Log Out" />
            </ListItem>
          </List>
        </Box>
      </Drawer>
      <Box component="main" sx={{ flexGrow: 1, p: 3, ml: `${drawerWidth}px` }}>
        <Toolbar />
        <Routes>
          <Route path="/fee-calculator" element={<FeeCalculatorPage />} />
          <Route path="/settings" element={<Settings />} />
          <Route path="/logout" element={<Logout />} />
          <Route path="/user-dashboard" element={<UserDashboard />} />
          <Route path="/products" element={<Products />} />
          <Route path="/productcard/:productId" element={<ProductCard />} />
        </Routes>
      </Box>
      {/* Search Box */}
      <Container maxWidth="sm" sx={{ mt: 2, backgroundColor: '#333', color: '#fff', p: 4, borderRadius: 2 }}>
        <Typography variant="h4" sx={{ textAlign: 'center', mb: 2 }}>Products</Typography>
        <Paper sx={{ p: 2, display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
          <TextField
            fullWidth
            variant="outlined"
            placeholder="Search products"
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            onKeyDown={handleKeyDown} // Trigger search on Enter
            sx={{ mb: 2, backgroundColor: "#222", color: "#fff", borderRadius: 1, '& .MuiOutlinedInput-root': { color: '#fff' } }}
          />
          <Button variant="contained" color="primary" onClick={handleSearch} disabled={loading} sx={{ backgroundColor: '#1e88e5', '&:hover': { backgroundColor: '#1565c0' } }}>
            {loading ? <CircularProgress size={24} /> : 'Search'}
          </Button>
        </Paper>
      </Container>
      <Container sx={{ mt: 4 }}>
        <Grid container spacing={4}>
          {products.map((product) => (
            <Grid item key={product.id} xs={12} sm={6} md={4}>
              <Paper
                sx={{ p: 2, cursor: 'pointer', '&:hover': { boxShadow: 6 } }}
                onClick={() => {
                  const productId = parseInt(product?.id, 10);
                  if (!isNaN(productId)) {
                    navigate(`/productcard/${productId}`);
                  } else {
                    console.error('Invalid product ID:', product?.id);
                  }
                }}
              >
                <img
                  src={product.image_url}
                  alt={product.name}
                  style={{ width: '100%', borderRadius: '4px' }}
                />
                <Typography variant="h6" sx={{ mt: 2 }}>
                  {product.name}
                </Typography>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Container>
    </ThemeProvider>
  );
}

export default Products;
